class Solution {
public:
    int maxOperations(string s) {
        int ones=0, res=0, f=0;
        for(int i=0; i<s.size(); i++){
            if(s[i]=='1'){
                ones++;
                f = 1;
            }
            else{
                if(f) res += ones;
                f = 0;
            }
        }
        return res;
    }
};
